from fastapi import FastAPI
from pydantic import BaseModel
import json
import requests
from geopy.distance import geodesic
from mangum import Mangum 

app = FastAPI()
handler= Mangum(app)

class CoordsModel(BaseModel):
    coordinates: list[float]
#lng,lat

class DatosEntrada(BaseModel):
    origen: list[CoordsModel]
    destino: list[CoordsModel]
@app.get("/")
def hello():
    list_ida, list_reg,name_ida,name_reg = process_data(ident=100)
    return(list_ida, list_reg,name_ida,name_reg)

@app.post("/procesar_datos")
async def procesar_datos(datos: DatosEntrada):
    # Accede a los datos de la solicitud
    origen_coords = datos.origen[0].coordinates[::-1]
    destino_coords = datos.destino[0].coordinates[::-1]
    
    # Lista de identificadores de rutas
    list_ident = [100, 101, 214, 313, 316, 0, 561, 562]

    # Inicializar listas vacías para las coordenadas de la ruta de ida y regreso
    list_ida = []
    list_reg = []
    list_ida_modificada = []
    aux_origen=0
    aux_destino=0
    name_aux='Sin ruta disponible'
    group_list=[]
    suma_distancias=0
    distancia_umbral = 400  # Establece el umbral deseado en metros
    print('Ruta de ida:')
    
    for index in list_ident:
        list_ida, list_reg,name_ida,name_reg = process_data(ident=index)
        distancia_minima_origen_ruta_ida = float('inf')
        punto_mas_cercano_origen_ruta_ida = None
        distancia_minima_destino_ruta_ida = float('inf')
        punto_mas_cercano_destino_ruta_ida = None

        for coordenada in list_ida:
            distancia_ida = geodesic(origen_coords, coordenada).meters
            distancia_reg = geodesic(destino_coords, coordenada).meters
            # Encontrar el punto más cercano entre el origen y la ruta de ida
            if distancia_ida < distancia_minima_origen_ruta_ida:
                distancia_minima_origen_ruta_ida = round(distancia_ida,4)
                punto_mas_cercano_origen_ruta_ida = coordenada
            # Encontrar el punto más cercano entre el destino y la ruta de ida
            if distancia_reg < distancia_minima_destino_ruta_ida:
                    distancia_minima_destino_ruta_ida = round(distancia_reg,4)
                    punto_mas_cercano_destino_ruta_ida = coordenada
            
        
        if distancia_minima_origen_ruta_ida < distancia_umbral and distancia_minima_destino_ruta_ida < distancia_umbral:
           
            # Agregar las coordenadas desde el punto más cercano al origen hasta el punto más cercano al destino a la lista modificada
            index_origen = list_ida.index(punto_mas_cercano_origen_ruta_ida)
            index_destino = list_ida.index(punto_mas_cercano_destino_ruta_ida)
            aux_origen=index_origen
            aux_destino=index_destino
            list_ida_modificada = list_ida[index_origen:index_destino + 1]
            name_aux=name_ida
            if aux_origen<aux_destino:
                print(name_ida,':',distancia_minima_origen_ruta_ida,'m',punto_mas_cercano_origen_ruta_ida,'Origen') 
                print(name_ida,':',distancia_minima_destino_ruta_ida,'m',punto_mas_cercano_destino_ruta_ida,'Destino') 
                print('index_origen',index_origen,'--','index_destino',index_destino)
                suma_distancias=0
                for i in range(0,len(list_ida_modificada)-1):
                    distancia = geodesic(list_ida_modificada[i], list_ida_modificada[i+1]).kilometers
                    suma_distancias += distancia
                    
                #group_list=json.dumps({'coordenadas': list_ida_modificada})
                group_list.append({'name':name_aux,'coordinates':list_ida_modificada,'recorridoRuta':round(suma_distancias,2),'color':'red'})
            else:
                print('Ruta no valida',name_aux)
    
    print('Ruta de reg:')
    for index in list_ident:
        list_ida, list_reg,name_ida,name_reg = process_data(ident=index)
        distancia_minima_origen_ruta_ida = float('inf')
        punto_mas_cercano_origen_ruta_ida = None
        distancia_minima_destino_ruta_ida = float('inf')
        punto_mas_cercano_destino_ruta_ida = None
        for coordenada in list_reg:
            
            distancia_ida = geodesic(origen_coords, coordenada).meters
            distancia_reg = geodesic(destino_coords, coordenada).meters
            # Encontrar el punto más cercano entre el origen y la ruta de ida
            if distancia_ida < distancia_minima_origen_ruta_ida:
                distancia_minima_origen_ruta_ida = round(distancia_ida,4)
                punto_mas_cercano_origen_ruta_ida = coordenada
            # Encontrar el punto más cercano entre el destino y la ruta de ida
            if distancia_reg < distancia_minima_destino_ruta_ida:
                    distancia_minima_destino_ruta_ida = round(distancia_reg,4)
                    punto_mas_cercano_destino_ruta_ida = coordenada
            
        if distancia_minima_origen_ruta_ida < distancia_umbral and distancia_minima_destino_ruta_ida < distancia_umbral:
            # Agregar las coordenadas desde el punto más cercano al origen hasta el punto más cercano al destino a la lista modificada
            index_origen = list_reg.index(punto_mas_cercano_origen_ruta_ida)
            index_destino = list_reg.index(punto_mas_cercano_destino_ruta_ida)
           
            list_ida_modificada = list_reg[index_origen:index_destino+1]
            name_aux=name_reg
            if index_origen<index_destino:
                print(name_reg,':',distancia_minima_origen_ruta_ida,'m',punto_mas_cercano_origen_ruta_ida,'Origen') 
                print(name_reg,':',distancia_minima_destino_ruta_ida,'m',punto_mas_cercano_destino_ruta_ida,'Destino') 
                print('index_origen',index_origen,'--','index_destino',index_destino)
                suma_distancias=0
                for i in range(0,len(list_ida_modificada)-1):
                    distancia = geodesic(list_ida_modificada[i], list_ida_modificada[i+1]).kilometers
                    suma_distancias += distancia
                    
                #group_list=json.dumps({'coordenadas': list_ida_modificada})
                group_list.append({'name':name_aux,'coordinates':list_ida_modificada,'recorridoRuta':round(suma_distancias,2),'color':'blue'})
            else:
                print('Ruta no valida',name_aux)
                
    #print('Lista modificada',list_ida_modificada)
    return {'recomendaciones':group_list}   
    

