def load_file_content(ident):
    try:
        ruta = None
        if ident == 100:
            ruta = ruta_100
        elif ident == 101:
            ruta = ruta_101
        elif ident == 214:
            ruta = ruta_214
        elif ident == 313:
            ruta = ruta_313
        elif ident == 316:
            ruta = ruta_316
        elif ident == 0:
            ruta = ruta_316_dom
        elif ident == 561:
            ruta = ruta_561
        elif ident == 562:
            ruta = ruta_562
        
        if ruta:
            return ruta
        else:
            print("Identificador de archivo no válido.")
            return None
    except Exception as e:
        print(f"Error al cargar el archivo: {e}")
        return None

def process_data(ident):
    contenido = load_file_content(ident=ident)
    routpoints_ida = []
    routpoints_reg = []
    name_ida = None
    name_reg = None

    try:
        data = json.loads(contenido)
        for q in range(2):
            ruter = data['features'][q]['geometry']['coordinates']
            name_route = data['features'][q]['properties']['name']
            for coord in ruter:
                lat, long = coord[1], coord[0]
                if q == 0:
                    name_ida = name_route
                    routpoints_ida.append((lat, long))
                else:
                    name_reg = name_route
                    routpoints_reg.append((lat, long))
    except Exception as e:
        print(f"Error al analizar JSON: {e}")
        return None

    return routpoints_ida, routpoints_reg, name_ida, name_reg



